        "We Help people resolve any environmental reports fairly and promptly and ensure that everyone has the right to a safe and respectful environmental life in his/her local community at Al Raqqa, Hawwas, and Basaira in Syria.": "نحن نساعد الناس على حل أي مظالم بيئية بطريقة عادلة وفي الوقت المناسب ونضمن أن لجميع شخص الحق في حياة بيئية آمنة ومحترمة في مجتمعه المحلي في الرقة وحوس والبصيرة في سوريا.",
        "If you have any report apply now": "إذا كان لديك أي شكوى تقدم بطلب الآن",
        "About Us": "من نحن",
        "We are a local environmental community initiative that helps people resolving environmental reports. We understand that reports can be a difficult and stressful experience, and we are here to provide support and guidance through the process. We offer a confidential and comprehensive reports resolution service.": "نحن مبادرة بيئية في المجتمع المحلي تساعد الناس على حل المظالم في بيئتهم في جميع من الرقة وحوس وبصيرة في سوريا. نحن نتفهم أن المظالم يمكن أن تكون تجربة صعبة، ونحن هنا لتقديم الدعم والتوجيه من خلال هذه العملية. نقدم خدمة سرية وشاملة لحل هذه المظالم والتواصل مع الجهات المعنية لحلها.",
        "Our Objective": "أهدافنا",
        "Our objective is to help people by resolving their local community environmental reports in the targeted areas (Al Raqqa, Hawwas and Basaira) in a confidential, fair and timely manner. We believe that everyone has the right to a safe and respectful workplace, and we are committed to helping people achieve that goal": "نهدف لمساعدة الناس على حل مظالمهم البيئية في مجتمعهم المحلي في الأماكن المستهدفة، وبطريقة سرية وشفافة وعادلة وفي الوقت المناسب. نحن نؤمن بأن لجميع شخص الحق في مكان عمل آمن ومحترم، ونحن ملتزمون بمساعدة الناس على تحقيق هذا الهدف.",
