        "Confidentiality and Non-Disclosure Disclaimer": "إخلاء المسؤولية بشأن السرية وعدم الإفصاح",
        "The Environment Syria Platform (ESP) tool of the Local Environmental Committees Platform is committed to ensuring the utmost confidentiality of all information and data shared by users. Any information provided through this platform, including personal details, concerns, or grievances, will be treated with the highest level of discretion and will not be disclosed to any third party without explicit consent, except as required by law. Users are reminded that while every effort is made to maintain the confidentiality of their submissions, the internet's inherent security risks cannot be entirely eliminated, and they are encouraged to exercise caution when sharing sensitive information. By utilizing the Environment Syria Platform (ESP) tool of the Local Environmental Committees website, users acknowledge and accept these terms regarding confidentiality and non-disclosure.": "تلتزم منصة البيئة في سوريا (ESP) التابعة لمنصة اللجان البيئية المحلية بضمان أقصى درجات السرية لجميع المعلومات والبيانات التي يشاركها المستخدمون. سيتم التعامل مع أي معلومات يتم تقديمها من خلال هذه المنصة، بما في ذلك التفاصيل الشخصية أو المخاوف أو المظالم، بأعلى مستوى من التقدير ولن يتم الكشف عنها لأي طرف ثالث دون موافقة صريحة، باستثناء ما يقتضيه القانون. يتم تذكير المستخدمين بأنه على الرغم من بذل جميع جهد ممكن للحفاظ على سرية ما يرسلونه، إلا أنه لا يمكن القضاء على المخاطر الأمنية الكامنة في الإنترنت بشجميع كامل، ويتم تشجيعهم على توخي الحذر عند مشاركة المعلومات الحساسة. من خلال استخدام منصة البيئة في سوريا (ESP) على موقع اللجان البيئية المحلية، يقر المستخدمون ويقبلون هذه الشروط المتعلقة بالسرية وعدم الإفصاح.",
        "We are diverse local environmental committees, brought together by our shared commitment to environmental protection. Our primary role is to receive and process reports related to environmental issues in local communities of Al Raqqa, Hawwas and Bsaira and connect them with the responsible parties. With varied backgrounds and a common purpose, we work tirelessly to ensure our community's environmental concerns are heard and addressed. Join us in our mission to preserve and protect our environment for generations to come.": "نحن لجان بيئية محلية مختلفة، يجمعنا التزامنا المشترك بحماية البيئة. دورنا الأساسي هو تلقي ومعالجة التظلمات المتعلقة بالقضايا البيئية في المجتمعات المحلية في الرقة والحواس والبصيرة وربطها مع الجهات المسؤولة. ومع وجود خلفيات متنوعة وهدف مشترك، فإننا نعمل بلا كلل لضمان الاستماع إلى الاهتمامات البيئية لمجتمعنا ومعالجتها. انضم إلينا في مهمتنا المتمثلة في الحفاظ على بيئتنا وحمايتها للأجيال القادمة.",
        "Welcome to the Local Environmental Committees for Al Raqqa, Bsaira and Hawwas website, a platform to report on concerns about our local ecosystems. In a world grappling with climate change and environmental degradation, we aim to coordinate and collective action. Join us in our mission to address these challenges by reporting on environmental issues with in your communities.": "مرحبًا بكم في موقع لجان البيئة المحلية في الرقة و البصيرة و حوس ، وهي منصة للإبلاغ عن المخاوف بشأن أنظمتنا البيئية المحلية. وفي عالم يتصارع مع تغير المناخ والتدهور البيئي، نهدف إلى تنسيق العمل الجماعي. انضم إلينا في مهمتنا لمعالجة هذه التحديات من خلال الإبلاغ عن القضايا البيئية في مجتمعاتك.",
